const List = () => {
  return (
    <>
      <ul>
        {users.map((user) => (
          <li key={user.id}>{user.name}</li>
        ))}
      </ul>
      {isLoggin ? <Check /> : <h1>Login Again</h1>}
      {/* {isLoggin && <Check />} */}
    </>
  )
}

